import React, { useState, useEffect } from "react";
import axios from "../utils/axiosInstance";
import { useNavigate } from "react-router-dom";
import { Input } from "@/components/ui/input";
import { Textarea } from "@/components/ui/textarea";
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";
import { Plus, Trash2 } from "lucide-react";

const BlogAdminPanel = () => {
  const [posts, setPosts] = useState([]);
  const [form, setForm] = useState({
    title: "",
    slug: "",
    content: "",
    published: true,
  });
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    fetchPosts();
  }, []);

  const fetchPosts = async () => {
    const res = await axios.get("/api/blog");
    setPosts(res.data);
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({ ...form, [name]: type === "checkbox" ? checked : value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      await axios.post("/api/blog", form);
      setForm({ title: "", slug: "", content: "", published: true });
      fetchPosts();
    } catch (err) {
      alert("Kunne ikke oprette indlÃ¦g");
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (slug) => {
    if (!window.confirm("Slet indlÃ¦gget?")) return;
    try {
      await axios.delete(`/api/blog/${slug}`);
      fetchPosts();
    } catch (err) {
      alert("Kunne ikke slette indlÃ¦g");
    }
  };

  return (
    <div className="max-w-3xl mx-auto p-4">
      <h2 className="text-xl font-semibold mb-4">ðŸ§  Blog & Nyheds-admin</h2>

      <Card className="mb-6">
        <CardContent className="p-4">
          <form onSubmit={handleSubmit} className="space-y-3">
            <Input
              name="title"
              placeholder="Titel pÃ¥ indlÃ¦g"
              value={form.title}
              onChange={handleChange}
              required
            />
            <Input
              name="slug"
              placeholder="Slug (bruges i URL â€“ fx 'introduktion-til-gdpr')"
              value={form.slug}
              onChange={handleChange}
              required
            />
            <Textarea
              name="content"
              placeholder="Indholdet af indlÃ¦gget..."
              value={form.content}
              onChange={handleChange}
              rows={8}
              required
            />
            <label className="flex items-center space-x-2">
              <input
                type="checkbox"
                name="published"
                checked={form.published}
                onChange={handleChange}
              />
              <span>Udgiv med det samme</span>
            </label>
            <Button type="submit" disabled={loading}>
              <Plus size={16} className="mr-2" />
              {loading ? "Opretter..." : "Opret indlÃ¦g"}
            </Button>
          </form>
        </CardContent>
      </Card>

      <h3 className="text-lg font-medium mb-2">ðŸ“„ Eksisterende indlÃ¦g</h3>
      <ul className="space-y-2">
        {posts.map((post) => (
          <li key={post.id} className="border p-3 rounded-md flex justify-between items-center">
            <div>
              <strong>{post.title}</strong>
              <div className="text-sm text-gray-500">/blog/{post.slug}</div>
            </div>
            <div className="flex gap-3">
              <Button
                variant="secondary"
                onClick={() => navigate(`/blog/${post.slug}/edit`)}
              >
                Rediger
              </Button>
              <Button
                variant="destructive"
                onClick={() => handleDelete(post.slug)}
              >
                <Trash2 size={16} />
              </Button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BlogAdminPanel;
